import React from 'react';

class Home extends React.Component {
    render() {
        return (
            <div>
                <h1>Home</h1>
                <main style={{marginTop: '64px'}}>
                    <p className="header-text">Interior/Exterior Painting, Pressure Washing, Home Maintenance Needs, Insured</p>
                </main>
            </div>
        );
    }
}

export default Home;
